function getHTTP(url, callback){
    
    //console.log('getHTTP: ' + url);
    var options = {
        method:'GET',
        url: url,
        agentOptions: {
            rejectUnauthorized: false //Убираем ошибку типа UNABLE_TO_GET_ISSUER_CERT_LOCALLY для перехода в https
        },
        //imeout: 5000
    };
    request(options,  
        function (err, response) {
            //log( beautify( JSON.stringify(response)), 'NodeJS_Monitor_', true, 'INFO', true);
            if(!err){
                //console.log(response.statusCode);
                reqAnswer = response.statusCode
                m_targetStatusCode = response.statusCode
                m_targetHost = response.request.uri.hostname
                m_targetPort = response.request.uri.port
                m_targetHref = response.request.uri.href
                //расшифровка кодов состояния HTTP
                switch(response.statusCode){
                    case 200:
                        answerDtl = '200 OK — успешный запрос. Если клиентом были запрошены какие-либо данные, то они находятся в заголовке и/или теле сообщения.'
                        break;
                    case 403:
                        answerDtl = '403 Forbidden — сервер понял запрос, но он отказывается его выполнять из-за ограничений в доступе для клиента к указанному ресурсу. Если часто пинговать ресурс, тогда может возникнуть такая ошибка.'
                        break;
                    default:
                        answerDtl = response.statusCode + ' не заложен в алгоритмах определений кодов'
                        break;
                }

            } else {
                //console.log(err) //полный текст ошибки
                if(!JSON.stringify(err).split('code: ')){
                    m_targetStatusCode = 'ERR'
                    answerDtl = "this URL is black hole without error code"
                } else{
                    m_targetStatusCode = 'ERR'
                    answerDtl = JSON.parse(JSON.stringify(err).split('code: ').toString()).code;
                    answerDtl = answerDtl + ' ' + JSON.parse(JSON.stringify(err).split('address: ').toString()).address;
                    answerDtl = answerDtl + ' ' + JSON.parse(JSON.stringify(err).split('port: ').toString()).port;
                }
            };

            //Заменяем данные в массиве
            //monitorStorage = Object.assign({}, monitorStorage);

            //console.log(monitorStorage)
            answerNo = answerNo + 1;
            answersAhead = handleNo - answerNo; 
            //console.log ('Получен ответ на команду #: ' + answerNo)
            //console.log ('Осталось обработать команд: ' + answersAhead)
            //console.log('answer code: ' + m_targetStatusCode);
            if(m_targetStatusCode != 0){
                callback(); //Выход из функции
            }
          }
    );
}

function urlsHandler() {
    //Для всех url можно проверить статус, который возвращает HTTP страница
    //console.log('urlsHandler STARTED')
    comand = [];//В этом массиве будут собраны все команды, которые должен выполнять монитор
    answer = [];//В этом массиве соберутся все ответы
    handleNo = 0; //Нулевая позиция старта операций
    answerNo = 0; //Нулевая позиция ответов на операций

    urlsArray_hand = urlsArray.slice(0, urlsArray.length);//Копируем массив
    //console.log(urlsArray_hand);
    urlsArrLength = urlsArray_hand.length;
    for (var i = 0 ; i < urlsArrLength; i++) {
        url_Obj = urlsArray_hand.splice(0,1)
        //console.log(i);
        if(url_Obj.toString().length > 0){
            //Формирую таблицу вопросов и ответов
            comand[handleNo] = {
                "handle"  : handleNo,
                "func"    : "getHTTP",
                "params"  : {
                            "url": url_Obj.toString()
                            }
                };   
            answer[handleNo] =  {
                        "handle"        : handleNo,
                        "func"          : "getHTTP",
                        "target"        : url_Obj.toString(),
                        "answerStatus"  : '',
                        "answerDtl"     : ''
                        };
            }
        handleNo = handleNo + 1;
    };
};

function functionHandler(comand, callback) {
    comand.handle
    switch(comand.func) {
        case 'getHTTP':
        //console.log(comand.params.url)
            getHTTP(comand.params.url, function(){
                if(m_targetStatusCode != 0){
                    answer[comand.handle].answerStatus  = m_targetStatusCode;
                    answer[comand.handle].answerDtl     = answerDtl;
                    //Таблица ответов заполнена
                    callback()
                }
            });
            break;
        case 'getHTTPs':
            console.log('No HTTPs func available')
            break;
        default:
            console.log('> ??? <')
            break;
    }
}//functionHandler закрыт


